import './App.css';
import Recipes from '../recipes/Recipes.js'
import Header from '../header/Header.js'

function App() { 
    return(
    <div>
        <Header title="Recipes"/>
        {recipes.map((recipeTitle, index) => (
            <Recipes
            key={index}
            recipes={recipeTitle}/>
        ))}
    </div>
    ); 
}

export default App;
